static unsigned exam_pole()
{
	const symbol z{"z"}, z1{"z1"}, z2{"z2"};

	const ex points1 = lst{
		z1 == z/2, // pole on integration path
		z2 == numeric(1,10) + 2*I/17,
		z == numeric(1,6) + I/5
	};
	const ex points2 = lst{
		z1 == z/2, // pole on integration path
		z2 == -numeric(1,10) + 2*I/17,
		z == -numeric(1,6) + I/5
	};

	Digits = 40;
	const ex eps = pow(10,-30);

	auto evaluate = [&](const ex& points) {
		for (int deform = -1; deform <= +1; deform += 1) {
			// Evaluate expression in three different ways
			// Gt(lst{lst{1,z1},lst{1,z2}},z,I)
			cout << "  - Testing deformation " << std::showpos << deform << std::noshowpos << ": ";
			const int deform1 = (deform == 0) ? 1 : deform; // deform defaults to +1

			// Method 1: deform integration contour around pole
			const numeric n1 = Gt::ex_evaluate(Gt(lst{lst{1,z1,deform},lst{1,z2}},z,I), points);

			// Method 2: shift pole by small amount in the opposite direction
			const numeric n2 = Gt::ex_evaluate(Gt(lst{lst{1,z1*(1+eps*exp(I*deform1))},lst{1,z2}},z,I), points);

			// Method 3: explicitly specify contour that avoids pole
			std::vector<ex> path;
			path.emplace_back(0);
			path.emplace_back(z1*(1-eps*exp(I*deform1)));
			path.emplace_back(z);
			const numeric n3 = Gt::ex_evaluate(Gt(lst{lst{1,z1},lst{1,z2}},z,I).applyIntegrationPath(path), points);

			const numeric diff = max(abs(n1-n2),abs(n1-n3));
			const double digits_agreement = -(log(diff)/log(numeric(10))).to_double();
			if (digits_agreement > 20)
				cout << "succeeded" << endl;
			else {
				cout << "failed" << endl;
				cout << "    n1 = " << n1 << endl;
				cout << "    n2 = " << n2 << endl;
				cout << "    n3 = " << n3 << endl;
			}
		}
	};

	evaluate(points1);
	evaluate(points2);

	return 0;
}

unsigned exam_Gt(uint32_t selected_tests = 0xffffff)
{
	cout << "examining Gt:" << endl;

	// Default behaviour: run abbreviated tests
	if (selected_tests == 0xffffff) {
		unsigned result = 0;
		cout << "- examining full evaluation" << endl;
		result += exam_full(true);
		cout << "- examining banana tests" << endl;
		result += exam_banana(true);
		return result;
	}

	if (!(selected_tests & 255)) {
		cout << "No tests selected" << endl;
		return 255;
	}

	unsigned result = 0;
	
	if (selected_tests & 1) {
		cout << "- examining zisToFundamental" << endl;
		result += exam_zisToFundamental();
	}
	if (selected_tests & 2) {
		cout << "- examining regularise" << endl;
		result += exam_regularise();
	}
	if (selected_tests & 4) {
		cout << "- examining tauToFundamental" << endl;
		result += exam_tauToFundemantal();
	}
	if (selected_tests & 8) {
		cout << "- examining cutIntegrationPath" << endl;
		result += exam_cutIntegrationPath();
	}
	if (selected_tests & 16) {
		cout << "- examining qExpand (regular)" << endl;
		result += exam_qExpand();
		cout << "- examining qExpand (singular)" << endl;
		result += exam_qExpand_sing();
	}
	if (selected_tests & 32) {
		cout << "- examining full evaluation" << endl;
		result += exam_full(false);
	}
	if (selected_tests & 64) {
		cout << "- examining banana tests" << endl;
		result += exam_banana(false);
	}
	if (selected_tests & 128) {
		cout << "- examining pole tests" << endl;
		result += exam_pole();
	}

	return result;
}

int main(int argc, char** argv)
{
	// Take optional argument that specifies which tests to run
	uint32_t selected_tests = 0xffffff;
	if (argc > 1)
		std::sscanf(argv[1], "%u", &selected_tests);

	// By default, run abbreviated set of tests, which should take ~30s
	// Full set of test should take ~30m

	return exam_Gt(selected_tests);
}
